INSERT INTO `post_lang` VALUES (1,1,'ru','Объявление Педагогической филармонии','<div class=\"postbody\">\r\n<p>В рамках концертов Педагогической филармонии 16 ноября в Большом зале пройдет \"Концерт-Поэма\" Андрея Пыпина (балалайка) и Николая Саратовского (фортепиано)<br /> Начало концерта в 19:00</p>\r\n<p>Билеты Вы можете получить у администраторов в холле 1-го этажа в обмен на оплаченную квитанцию.</p>\r\n<p>Стоимость одного билета - 300 рублей</p>\r\n<p><a title=\"Квитанция филармония МИТЮША 300.pdf\" href=\"http://stravinskiy.arts.mos.ru/upload/medialibrary/c85/kvitantsiya-filarmoniya-mityusha-300.pdf\">КВИТАНЦИЮ можно скачать ЗДЕСЬ</a></p>\r\n<p>Стоимость трех билетов - 600 рублей</p>\r\n</div>'),(2,2,'ru','Объявление Козловой','<p>Уважаемые учащиеся и родители, 12 НОЯБРЯ (понедельник) занятия у преподавателя КОЗЛОВОЙ Н.Е. отменяются. 12</p>'),(4,4,'ru','Объявление','');
