ийного электронного оборудования;\r\n    Проектирование ( разработка технической документации, тех. заданий на оснащение электронным и другим оборудованием организации).\r\n    Разработка программного обеспечения.\r\n\r\n ','111-111-111 11'),(12,'markov-a','xnFGa6TdYUZGs-lu7p7qk_2CnTkmhQyt','$2y$13$0.nnMNjmaEVW7iIwoOtNHuS.kwXe9bfVegKKr0qwZgklwdqXnY6Fu',NULL,'artmarkov@mail.ru',10,3,1536650221,1542365528,0,'127.0.0.1','',1,NULL,NULL,'Артур','Владимировичь','Марков',1542326400,1,'+7 (111) 111 11 11','',NULL,'','111-111-111 11'),(14,'petrov-vv','joDq5ugpwnvr6VY0S-i0pKUH5qj-d9cO','$2y$13$Z0xKMpDcZIH2ZE8qZ7VrIOPVWIvrSPpajBrcE8oWWlAYahETwdBeK',NULL,'artmarkov@mail.ru',10,2,1540556010,1542363048,0,'127.0.0.1','',0,NULL,NULL,'Виктор','Владимирович','Петров',1258588800,1,'+7 (111) 111 11 11','+7 (222) 222 22 22',NULL,'','123-456-789 01'),(16,'batyr-ir',NULL,NULL,NULL,'artmarkov@mail.ru',10,2,1540745850,1542365508,0,NULL,'',0,NULL,NULL,'Ильдар','Рамилевич','Батыршин',566179200,0,'','',NULL,'',''),(17,'ivanov-ii','ON0VkY89hDPPEPhByNWrlE2dlJcOZQzv','KIoeBFx9.5ZfoMt7hxe8Mf9l0WhSsUZF1Cui92Os2fO/mP9TKS',NULL,'artmarkov@mail.ru',10,1,1540747835,1540747835,0,'::1','',0,NULL,NULL,'','','',1286654400,0,'','',NULL,'',''),(20,NULL,NULL,NULL,NULL,NULL,0,4,1541766016,1542365524,0,NULL,NULL,0,NULL,NULL,'Иван','Иванович','Пупкин',535507200,1,'','',NULL,NULL,''),(21,NULL,NULL,NULL,NULL,NULL,0,4,1541768847,1542364234,0,NULL,NULL,0,NULL,NULL,'Иван','Иванович','Зубков',-759196800,1,'','',NULL,NULL,''),(22,NULL,NULL,NULL,NULL,NULL,0,3,1541943878,1541943878,0,NULL,NULL,0,NULL,NULL,'Андрей','Васильевич','Чернов',566254800,1,'+7 (123) 456 78 90','',NULL,NULL,'123-456-789 12'),(23,NULL,NULL,NULL,NULL,NULL,0,3,1541944252,1542020928,0,NULL,NULL,0,NULL,NULL,'Макар','Васильевич','Чернов',597877200,0,'','',NULL,NULL,'');
